import React from "react";
import './ErroeModal.css'

const ErrorModal= (props) =>{
    return( <div className="modal">
      <header className="header">
        <h2 >{props.title}</h2>
      </header>  
      <p className="content">{props.message}</p>
      <footer className="actions">
        <button>Okay!</button>
      </footer>
        </div>
    )

}
export default ErrorModal;
